import  Link from 'next/link';
const about = () => (
    <div>
    <ul>
    <li><Link href="/"><a>home</a></Link></li>
 <li><Link href="/abouts"><a>about</a></Link></li>
    </ul> 
        
    <p>this is the about 
        page of the application 
        im building with next js</p>
    
    
    
    </div>
);

    export default about;
